import React from 'react';
import { Calendar } from 'antd';

const MonthCell = () => {
  return (
    <>
      <div style={{ backgroundColor:'yellow', textAlign: 'center'}}>
        <Calendar />
      </div>
    </>
  )
}

export default MonthCell;
